DROP TABLE IF EXISTS "vots";
CREATE TABLE "vots" (
"PK_UID" INTEGER PRIMARY KEY AUTOINCREMENT,
"OBJECTID" INTEGER,
"Name" TEXT,
"Type" TEXT,
"Address" TEXT,
"City" TEXT,
"Notes" TEXT,
"Open_Sched" TEXT,
"Close_Sche" TEXT,
"Active" INTEGER,
"Status" TEXT,
"Zip" TEXT,
"Phone" TEXT,
"Picture" TEXT, "Geometry" POINT);
